import { ActionTypes,
     GetCandidatesResultAction
} from "./type";

export const getCandidates = () => ({
    type: ActionTypes.get_candidates,
});
export const getCandidatesResult = (hasError: boolean): GetCandidatesResultAction => ({
    type: ActionTypes.get_candidates_result,
    hasError
});
